In C, the `malloc`, `calloc`, and `realloc` functions are used for dynamic memory allocation. Here's a simple implementation of these functions in C:

1. malloc:

```c
#include <stdio.h>
#include <stdlib.h>

void *my_malloc(size_t size) {
    void *ptr = malloc(size);
    if (ptr == NULL) {
        fprintf(stderr, "Memory allocation failed\n");
        exit(EXIT_FAILURE);
    }
    return ptr;
}
```

2. calloc:

```c
void *my_calloc(size_t nmemb, size_t size) {
    void *ptr = calloc(nmemb, size);
    if (ptr == NULL) {
        fprintf(stderr, "Memory allocation failed\n");
        exit(EXIT_FAILURE);
    }
    return ptr;
}
```

3. realloc:

```c
void *my_realloc(void *ptr, size_t size) {
    void *new_ptr = realloc(ptr, size);
    if (new_ptr == NULL) {
        fprintf(stderr, "Memory allocation failed\n");
        exit(EXIT_FAILURE);
    }
    return new_ptr;
}
```

These functions are similar to the standard library functions, but they include error handling for memory allocation failures. You can use them in your programs to dynamically allocate memory.

Remember to include the `<stdlib.h>` header file to use these functions. Also, don't forget to free the memory when it's no longer needed to avoid memory leaks.

